import React from 'react';

function Home() {
  return (
    <div>
      <h1>Welcome to Music Match</h1>
      <h3>Please Login/ Sign up</h3>
      <a className="btn btn-success btn-lg display-flex">Log in</a>
      <a className="btn btn-success btn-lg display-flex">Sign up</a>
    </div>
  )
}

export default Home;
